import React from 'react';
import { Link } from 'react-router-dom';
export default function Navbar() {
  return (
    <>
      <header className='header'>
        <Link to='/'>
          <h1>게시판</h1>
        </Link>
      </header>
      <nav>
        <Link to='/'>Home</Link>
        <Link to='board'>Board</Link>
      </nav>
      </>
  );
}
